import React from 'react';
import s from './Header.module.css'
import {NavLink} from "react-router-dom";
import {UnLoginThunk} from "../../Readux/Reducer-Auth";

const Header = (props) => {
    const unlogin = ()=>{
props.UnLoginThunk()
    }
    return (
        <header className={s.main}>
            <div><img className={s.logo}
                      src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/1280px-React-icon.svg.png"/>
            </div>
            <div className={s.wrapper_login}>
                {props.isAuth ?  <div>{props.login}-<button onClick={unlogin}>unlogin</button></div>: <div> <NavLink className={s.login} to="/login">login</NavLink></div>}

            </div>

        </header>
    );
}

export default Header;
